import React, { Component } from "react";
import Views from "../assets/icons/SVG/Icon-views.svg";
import Likes from "../assets/icons/SVG/Icon-likes.svg";

class Clip extends Component {
  state = {
    video: {}
  };

  render() {
    return (
      <section className="clip">
        <div className="clip__title">{this.state.video.title}</div>
        <div id="clip">
          <div className="clip__letters">
            <div id="channel">{this.state.video.channel}</div>
            <div id="date">{this.state.video.timestamp}</div>
          </div>
          <div className="clip__likes">
            <div id="views">
              <img src={Views} alt="views" />
              {this.state.video.views}
            </div>
            <div id="hearts">
              <img src={Likes} alt="likes" />
              {this.state.video.likes}
            </div>
          </div>
        </div>
        <div className="clip__description">{this.state.video.description}</div>
      </section>
    );
  }
}

export default Clip;
